import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";
import Searchform from "../SearchForm/SearchForm";
import titleLogo from "../../images/shittybookicon.svg";
import dropDownLogo from "../../images/shittydropdown.svg";

const Navbar = () => {
  const [toggleMenu, setToggleMenu] = useState(false);

  const handleNavbar = () => setToggleMenu(!toggleMenu);

  return (
    <nav className="font-radiocanada"  id="navbar">
      <div className="flex flex-row justify-between p-3 bg-backgroundwhite rounded-sm">
        <div>
          <Link to="/" className="flex flex-row items-center">
            <img className='mr-2' src={titleLogo} alt="site logo" height={75} width={75} />
            <h1 className="text-3xl font-extrabold text-mainblue">Magic Library</h1>
          </Link>
        </div>
          <div className={`${toggleMenu ? "navbar-show" : "navbar-collapse"} flex items-center`}>
              <Searchform />
              <span className="border-1 h-60 w-0.5 bg-darkwhite border-black"></span>
              <button className="mx-3">
              Sign in
              </button>
              <button className="mx-3 bg-mainblue p-3 text-backgroundwhite rounded-xl shadow-md" >
              Sign up
              </button>

              {/* <button
                type="button"
